import React from 'react'

class NavBar extends React.Component {
    render() {
        return (
            <div>

                <nav id="nav-bar__responsive">

                    <div className="nav-bar__icon">
                        <img src="../images/icon.png" alt="Rolgus icon minecraft"/>
                     </div>

                        <div className="nav-bar__responsive-title">

                            <h2>Rolgus</h2>
                        </div>


                        <div className="nav__div-responsive">
                            <div className="nav__div__responsive-menu">

                                <i className="bx bx-menu menu__responsive" href="#">Icon</i>
                            </div>
                        </div>

                </nav>
            </div>
        )
    }
}


export default NavBar;
